def comb_sort(lst):
    def get_next_gap(gap):
        gap = (gap * 10) // 13
        if gap < 1:
            return 1
        return gap

    n = len(lst)
    gap = n
    swapped = True

    while gap != 1 or swapped:
        gap = get_next_gap(gap)
        swapped = False

        for i in range(0, n - gap):
            j = i + gap
            if lst[i] > lst[j]:
                lst[i], lst[j] = lst[j], lst[i]
                swapped = True

    return lst

